import React from "react";
import styled from "styled-components";
import { motion, useAnimate } from "framer-motion";


const Cart = (props:any) => {

    const [scope, animate] = useAnimate()

    return(
        <div style={{position:'absolute', height:'100%', width:'30%', backgroundColor:'#0F52BA', 
        top:"0px", left:"70%", zIndex:1, borderWidth:"5px", borderColor:'red', borderStyle:'solid', 
        boxSizing:'border-box'}}>

        </div>

        // <motion.div
        // ini>

        // </motion.div>
    )

}

export default Cart;
